INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'Opis dostawy','conditions, delivery, delay, shipment, pack','<p class=\"tw-data-text tw-text-large tw-ta\" id=\"tw-target-text\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\"><strong>Wysyłki i zwroty</strong> </span></p>\n<p class=\"tw-data-text tw-text-large tw-ta\" style=\"text-align:left;\" dir=\"ltr\"><span class=\"Y2IQFc\" xml:lang=\"pl\" lang=\"pl\">Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i są wysyłane za pośrednictwem firmy UPS ze śledzeniem i nadawaniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jakiego rodzaju przesyłki wybierzesz, otrzymasz od nas link do śledzenia przesyłki online. Opłaty za wysyłkę obejmują opłaty manipulacyjne i koszty pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Zalecamy zgrupowanie artykułów w jednym zamówieniu. Nie możemy zgrupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą naliczane dla każdego z nich. Paczka zostanie wysłana na własne ryzyko, ale należy zachować szczególną ostrożność w celu ochrony delikatnych przedmiotów. Pudełka są pokaźnych rozmiarów, a Twoje przedmioty są dobrze chronione.</span></p>','delivery'),
('2','1','1','Nota prawna',NULL,'Nota prawna','notice, legal, credits','<h2>Nota prawna</h2>\n<p>Ta strona powstala z wykorzystaniem oprogramowania otwarte-zrodlo <a href=\"http://www.prestashop.com\">PrestaSklep</a>™</p>','legal-notice'),
('3','1','1','Polityka prywatności',NULL,'Nasza polityka prywatności','conditions, terms, use, sell','<h2>Nasza polityka prywatno<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b>ści</b></span></span></h2>\n<h3>Zasada 1</h3>\n<p>Nie m<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ówimy o naszej polityce prywatno</span></span><span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ści</span></span></p>','terms-and-conditions-of-use'),
('4','1','1','O nas',NULL,'Ucz się o nas','about us, informations','<h2>O nas</h2>\n<h3>Nasza firma</h3>\n<p>Dobry styl ma</p>\n<h3>Nasz zesp<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b>ó</b></span></span><span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\"><b>ł</b></span></span></h3>\n<p>Nie przeprowadza test<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ów</span></span></p>\n<h3>Informacje</h3>\n<p>Im mniej wiesz tym lepiej <span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ś</span></span>pisz</p>','about-us'),
('5','1','1','Bezpieczne płatności',NULL,'Bezpieczeństwo naszych płatności','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczne płatności</h2>\n<h3>Bezpieczeństwo naszych płatności</h3>\n<p>U<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ż</span></span>ywamy SSL ale certyfikat jest samopodpisany wi<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ę</span></span>c troch<span class=\"ILfuVd\" lang=\"pl\" xml:lang=\"pl\"><span class=\"hgKElc\">ę</span></span> lipa</p>','secure-payment');
