('193','1','1','<p>Mr. Plaza to jednorzędowa marynarka z tkaniny w kolorze granatowym. Wykonana z gładkiej tkaniny wełnianej super 110\'s z wykończeniem natural stretch. To specjalne wykończenie, polegające na wykurczeniu tkaniny w końcowej fazie produkcji. Dzięki temu jest ona elastyczna bez dodawania włókien syntetycznych. Takie rozwiązanie gwarantuje, że tkanina doskonale dopasowuje się do sylwetki i jest bardziej odporna na zagniecenia. Zapewnia to duży komfort noszenia i perfekcyjny wygląd ubioru przez cały dzień. Marynarka Mr. Plaza ma dopasowany do sylwetki fason. Jest zapinana na dwa guziki. Klapy proste, dwie dwuwypustkowe kieszenie boczne z patkami oraz kieszeń na piersi z listewką. Z tyłu dwa rozcięcia. Wytrzymała, miła w dotyku podszewka w groszki dodaje całości charakteru. Całość wykończona ozdobnym przeszyciem AMF, nawiązującym do krawiectwa w tradycyjnym stylu. Marynarka tworzy komplet ze spodniami.</p>','<p>100% Wełna super 110\'s, podszewka: 100% Wiskoza, podszewka rękawów: 56% Acetat, 44% Wiskoza</p>','mix-match-marynarka-slim-fit-do-garnituru',NULL,NULL,NULL,'MIX & MATCH - Marynarka slim fit do garnituru','Dostępny','Niedostępny',NULL,NULL),
